import './App.css';
import Navbar from './components/Navbar';
import Home from './pages/Home.js';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

function App() {
  return (
    <div className="App">
    <Navbar/>
    <Routes>
    <Route path='/welcome' element={<Home/>} />
    </Routes>
    </div>
  );
}

export default App;
